import './App.css';

function MyButton() {


}

function Login() {


  return (
    <div>
      <h1>{title}</h1>
      <h2>{description}</h2>
    </div>
  );
}

function Home() {

  return (
    <div>
      <h1>Home</h1>
    </div>
  );
}

function App() {

  let content;
  let isLogged: boolean = false;
  const [count, setCount] = useState(0);
  let title: string = "ft_transcendence";
  let description: string = "Connect to play Pong versus other players and show everyone how good you are !";

  function handleClick() {
    alert('You clicked me!');
    setCount(count + 1);
    isLogged = true;
  }


  if (isLogged === false) {
    return (
      <div>
        <h1>ft_transcendence</h1>
        <h2>{description}</h2>
      </div>
    );
  }
  else {
    content = <Home />
  }

  return (
    <div>
      {content}
    </div>
  );
}

export default App;
